pragma solidity 0.5.12;
import "@openzeppelin/contracts/ownership/Ownable.sol";
import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "./IPrivateCompany.sol";
import "./IPrivateCompanyFactory.sol";


contract PrivateExchangeLogic is Initializable, Ownable {event __CoveragePrivateExchangeLogic(string fileName, uint256 lineNumber);
event __FunctionCoveragePrivateExchangeLogic(string fileName, uint256 fnId);
event __StatementCoveragePrivateExchangeLogic(string fileName, uint256 statementId);
event __BranchCoveragePrivateExchangeLogic(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoveragePrivateExchangeLogic(string fileName, uint256 branchId);
event __AssertPostCoveragePrivateExchangeLogic(string fileName, uint256 branchId);

    using SafeMath for uint256;

    IPrivateCompany public exchangeToken;

    mapping(address => uint256) public listedCompanyPrices;

    IPrivateCompany[] public listedCompanies;

    mapping(address => IPrivateCompany[]) public ownerCompanies;

    bool private _openMode;

    IPrivateCompanyFactory private _companyFactory;

    event ExchangeClosed();

    event ExchangeOpened();

    event CompanyListed(address indexed owner, address indexed company);

    event ExchangeTokenPurchased(address indexed account, address amount);

    event ShareTransaction(
        address indexed company,
        address indexed buyer,
        address indexed seller,
        uint256 amount,
        uint256 price
    );

    event CompanyPriceUpdated(address indexed company, uint256 price);

    //We must set the owner in the initializer func due to the proxy pattern.
    //State in this contract is meaningless through a proxy.
    function initialize(
        address owner,
        address companyFactory,
        string memory name,
        string memory symbol
    ) public initializer {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',1);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',50);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',1);
_transferOwnership(owner);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',51);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',2);
_openMode = false;
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',52);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',3);
_companyFactory = IPrivateCompanyFactory(companyFactory);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',53);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',4);
exchangeToken = _makeExchangeToken(name, symbol);
    }

    function upgradeCompanyFactory(address companyFactory) public onlyOwner {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',2);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',57);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',5);
_companyFactory = IPrivateCompanyFactory(companyFactory);
    }


    function numberOfListedCompanies()      public returns(uint256) {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',3);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',62);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',6);
return listedCompanies.length;
    }

    function numberOfOwnedCompanies()      public returns(uint256) {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',4);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',66);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',7);
return ownerCompanies[msg.sender].length;
    }

    modifier onlyOpen() {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',5);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',70);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',1);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',8);
require(isOpen(), "not in open mode");emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',1);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',71);
        _;
    }

    function isOpen() public      returns (bool) {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',6);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',75);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',9);
return _openMode;
    }

    function switchOpenMode(bool value) public onlyOwner {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',7);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',79);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',10);
_openMode = value;
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',80);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',11);
if (value){emit __BranchCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',2,0);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',81);
            emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',12);
emit ExchangeOpened();
        }
        else {emit __BranchCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',2,1);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',84);
            emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',13);
emit ExchangeClosed();
        }
    }

    function exchangeTokenStaked() public      returns(uint256) {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',8);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',89);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',14);
return exchangeToken.allowance(msg.sender, address(this));
    }

    function exchangeTokenBalance() public      returns(uint256) {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',9);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',93);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',15);
return exchangeToken.balanceOf(msg.sender);
    }

    /**
    * @dev buys the exchange token using ether carried in msg.value
    *  
    */
    function buyExchangeToken() public payable onlyOpen {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',10);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',101);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',3);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',16);
require(msg.value>0, "value needs to be non-zero");emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',3);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',102);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',17);
exchangeToken.mint(msg.value);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',103);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',18);
exchangeToken.transfer(msg.sender, msg.value);
    }

    /**
    * @dev issue a buy transaction on the exchange. Note amount param!
    * because we defined price as per ether unit of shares, 
    * we must divide the price by 1 ether unit 
    * when we calculate the cost to the buyer as amount is given in wei
    * @param company address of company that MUST be listed in listedCompanies 
    * @param amount amount of shares to buy in wei units
    */
    function buyCompanyShares(address company, uint256 amount) public onlyOpen {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',11);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',115);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',4);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',19);
require(_isListedCompany(company), "not a listed company");emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',4);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',116);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',20);
uint256 price = listedCompanyPrices[company];
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',117);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',21);
address buyer = msg.sender;
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',118);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',22);
IPrivateCompany pc = IPrivateCompany(company);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',119);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',23);
address seller = pc.owner();
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',120);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',24);
uint256 cost = amount.mul(price).div(1 ether);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',121);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',25);
uint256 sharesAvailable = pc.allowance(seller, address(this));
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',122);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',5);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',26);
require(sharesAvailable >= amount, 
            "seller does not have enough shares to fill transaction"
        );emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',5);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',125);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',6);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',27);
require(exchangeToken.allowance(buyer, address(this)) >= cost, 
            "buyer does not have enough exchange tokens to fill transaction"
        );emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',6);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',128);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',28);
pc.transferFrom(seller, buyer, amount);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',129);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',29);
exchangeToken.transferFrom(buyer, seller, cost);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',130);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',30);
emit ShareTransaction(company, buyer, seller, amount, price);
    }

    /**
    * @dev updates the price of a listed company.
    * @param company address of company that MUST be listed in listedCompanies 
    * @param price per ONE ETH unit of shares. min = uint256 1. 
    * OR 0.000000000000000001 EE$ per ONE ETH unit of shares
    */
    function updateCompanyPrice(address company, uint256 price) public onlyOpen {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',12);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',140);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',31);
uint256 _price = listedCompanyPrices[company];
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',141);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',7);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',32);
require(_price > 0, "company is not listed");emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',7);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',142);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',33);
IPrivateCompany pc = IPrivateCompany(company);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',143);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',8);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',34);
require(pc.owner() == msg.sender, "price-setter is not the company owner");emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',8);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',144);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',9);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',35);
require(price > 0 , "price is not set as a positive integer");emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',9);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',145);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',36);
_updateCompanyPrice(company, price);
    }

    function _updateCompanyPrice(address company, uint256 price) internal {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',13);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',149);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',37);
listedCompanyPrices[company] = price;
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',150);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',38);
emit CompanyPriceUpdated(company, price);
    }

    function createCompanyAndList(
        string memory name,
        string memory symbol,
        uint256 price
    ) public onlyOpen {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',14);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',158);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',39);
bytes32 emptyString = keccak256(abi.encodePacked(""));
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',159);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',10);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',40);
require(keccak256(abi.encodePacked(name)) != emptyString, "empty name given");emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',10);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',160);
        emit __AssertPreCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',11);
emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',41);
require(keccak256(abi.encodePacked(symbol)) != emptyString, "empty symbol given");emit __AssertPostCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',11);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',161);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',42);
address companyOwner = msg.sender;
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',162);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',43);
IPrivateCompany c = _createCompany(companyOwner, name, symbol);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',163);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',44);
_listCompany(c);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',164);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',45);
_updateCompanyPrice(address(c), price);
    }

    function listCompany(address company, uint256 price) public onlyOwner {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',15);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',168);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',46);
IPrivateCompany pc = IPrivateCompany(company);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',169);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',47);
_updateCompanyPrice(company, price);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',170);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',48);
_listCompany(pc);
    }

    function delistCompany(address company) public onlyOwner {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',16);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',174);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',49);
_delistCompany(IPrivateCompany(company));
    }

    function _makeExchangeToken(
        string memory name,
        string memory symbol
    ) internal returns (IPrivateCompany) {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',17);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',181);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',50);
return _createCompany(address(this), name, symbol);
    }

    function _createCompany(
        address companyOwner,
        string memory name,
        string memory symbol
    ) 
    internal returns(IPrivateCompany) {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',18);

        //EXTERNAL CONTRACT CALL
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',191);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',51);
address c = _companyFactory.newCompany(companyOwner, name, symbol);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',192);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',52);
return IPrivateCompany(c); 
    }

    function _isListedCompany(address company) internal      returns(bool) {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',19);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',196);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',53);
return listedCompanyPrices[company] > 0;
    }
    function _listCompany(IPrivateCompany company) internal {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',20);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',199);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',54);
listedCompanies.push(company);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',200);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',55);
ownerCompanies[company.owner()].push(company);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',201);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',56);
emit CompanyListed(company.owner(), address(company));
    }

    function _delistCompany(IPrivateCompany company) internal {emit __FunctionCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',21);

emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',205);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',57);
listedCompanyPrices[address(company)] = 0;
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',206);
        emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',58);
for (uint i = 0; i < listedCompanies.length; i++ )
        {
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',208);
            emit __StatementCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',59);
if (listedCompanies[i] == company)
            {emit __BranchCoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',12,0);
emit __CoveragePrivateExchangeLogic('/home/shuloh/Code/entangle-exchange/contracts/PrivateExchangeLogic.sol',210);
